LAHORE, Jun 16 (APP): Governor Punjab Sardar Saleem Haider Khan Sunday called on Prime Minister Muhammad Shehbaz Sharif here and discussed matters pertaining to the Punjab province.
In the meeting, they also exchanged Eid-ul-Adha greetings in advance and expressed best wishes for each other.
